import Layout from '../components/MyLayout';
import HomeHead from '../components/HomeHead';


export default function Index() {
  return (
    <Layout>


      <HomeHead />

      <div>


      </div>
      <p>Hello Next.js</p>

      <style jsx>{`
        body {
          margin: 0 !important;
        }
        h1,
        a {
          font-family: 'Arial';
        }

        ul {
          padding: 0;
        }

        li {
          list-style: none;
          margin: 5px 0;
        }

        a {
          text-decoration: none;
          color: blue;
        }

        a:hover {
          opacity: 0.6;
        }
      `}</style>


    </Layout>
  );
}
